import React from "react";
import { Link } from "react-router-dom";
const Navbar=()=>{
    return(
        <div>
            <h1>This is navbar</h1>
            <ul>
          <Link to="">      <li>
                    Home
                </li></Link>
                <Link to="/dashboard">      <li>
                    Dashboard
                </li></Link>
                <Link to="/about">   <li>
                    About
                </li></Link>
            </ul>
        </div>
    )
}
